import React, { useEffect, useState } from "react";
import axios from "axios";

const EmployeeAttendance = () => {
  const [employees, setEmployees] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchEmployees = async () => {
      setLoading(true);
      try {
        const response = await axios.get("http://localhost:3005/employees/${employeeId}/attendance-list");
        setEmployees(response.data);
      } catch (err) {
        setError("Error fetching employees. Please try again later.");
        console.error("Error fetching employees:", err);
      } finally {
        setLoading(false);
      }
    };

    fetchEmployees();
  }, []);

  const daysInMonth = Array.from({ length: 31 }, (_, i) => i + 1); // Days 1 to 31

  return (
    <div className="p-6 max-w-7xl mx-auto bg-gray-100 rounded-lg shadow-lg">
      <h2 className="text-4xl font-bold mb-6 text-center text-blue-600">Employee Attendance</h2>
      {loading ? (
        <p className="text-center text-gray-500">Loading attendance...</p>
      ) : error ? (
        <p className="text-center text-red-500">{error}</p>
      ) : employees.length > 0 ? (
        employees.map((employee) => (
          <div key={employee.employeeId} className="mb-8">
            {/* Employee Details */}
            <div className="bg-blue-500 text-white p-4 rounded-lg">
              <h3 className="text-2xl font-semibold">Employee Details</h3>
              <p><strong>ID:</strong> {employee.employeeId}</p>
              <p><strong>Name:</strong> {employee.name}</p>
              <p><strong>Mobile Number:</strong> {employee.mobileNumber}</p>
            </div>

            {/* Attendance Table */}
            <table className="min-w-full bg-white mt-4 border border-gray-300 rounded-lg shadow-md">
              <thead className="bg-gray-200">
                <tr>
                  <th className="border border-gray-300 px-4 py-2 text-left text-sm font-medium text-gray-600">Date</th>
                  <th className="border border-gray-300 px-4 py-2 text-left text-sm font-medium text-gray-600">Status</th>
                  <th className="border border-gray-300 px-4 py-2 text-left text-sm font-medium text-gray-600">Reason for Leave</th>
                </tr>
              </thead>
              <tbody>
                {daysInMonth.map((day) => (
                  <tr key={day} className="hover:bg-gray-100 transition-colors duration-200">
                    <td className="border border-gray-300 px-4 py-2">{day}</td>
                    <td className="border border-gray-300 px-4 py-2">
                      {/* You can use conditional coloring based on status */}
                      <span className={`inline-block px-3 py-1 rounded-full text-sm font-bold ${
                        day % 2 === 0 ? "bg-green-100 text-green-600" : "bg-red-100 text-red-600"
                      }`}>
                        {day % 2 === 0 ? "Present" : "Absent"}
                      </span>
                    </td>
                    <td className="border border-gray-300 px-4 py-2">
                      {/* Show reason for leave only if Absent */}
                      {day % 2 !== 0 && (
                        <span className="text-red-500">Sick Leave</span>
                      )}
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>

            {/* Complaints Button */}
            <div className="mt-4 text-right">
              <button className="bg-yellow-500 hover:bg-yellow-700 text-white font-bold py-2 px-4 rounded">
                File a Complaint
              </button>
            </div>
          </div>
        ))
      ) : (
        <p className="text-center text-gray-500">No employees available.</p>
      )}
    </div>
  );
};

export default EmployeeAttendance;
